class NodeBuilder {
  _seedNode;
  _trailingOperator;
  _tail;

  constructor(node) {
    this._seedNode    = node;
    this.fillOperator = getOperatorIterator(node);
  }

  get seedNode() {
    return this._seedNode;
  }

  initTail() {
    const node = this.seedNode;
    if (!node.tail) { return; }

    this._tail = new Tail(node.tail, this._trailingOperator, !!this._trailingOperator);

    return this._tail;
  }

  initBody() {
    const node = this.seedNode;
    const body = node?.body;
    if (!body) { return; }

    const items = [];
    for (const item of body) {
      items.push(new BodyItem(item, this._trailingOperator, false));
      this._trailingOperator = this.fillOperator();
    }

    this._body = new Body(items);

    return this._body;
  }

  initHead() {
    const node   = this.seedNode;
    let operator = this.fillOperator();
    if (node.head) {
      this._head = new Head(node.head, operator);
      operator   = undefined;
    }
    this._trailingOperator = operator;

    return this._head;
  }

  * generate() {
    const head = this.initHead();
    if (head) yield  head;

    const body = this.initBody();
    if (body) yield  body;

    const tail = this.initTail();
    if (tail) yield  tail;
  }

}

function getOperatorIterator(iterable) {
  let i = 0;
  return function () {
    const operator = iterable.operators?.[i];
    i++;
    return operator;
  };
}

export class Scope {
  constructor(parent, context) {
    this.generation = (parent?.generation ?? -1) + 1;
    this.context    = context ?? parent;
    this.root       = parent.root ?? parent;
  }

  spawn(context) {
    return new Scope(this, context);
  }

  key(item) {
    return item;
  }

  check(node) {
    return !!node;
  }

  get prefix() {
    if (!this.doPrefix) return;
    return `{`
  }

  get doPrefix() {
    return false; //(this.generation === 4);
  }

  get suffix() {
    if (!this.doPrefix) return;
    return '}';
  }

  * loop(_node) {
    if (Array.isArray(_node)) {
      for (const i of _node) {
        yield _node;
      }
      return;
    }

    if (!this.check(_node)) return;

    const nodeBuilder = new NodeBuilder(_node);
    if (this.prefix)
      yield this.prefix;


    yield* nodeBuilder.generate();

    if (this.suffix)
      yield this.suffix;
  }

}

const openConcept   = {name: 'open-conceptual', key: '"', opposite: '"', kind: 'delimiter', open: true};
const openLocation  = {name: 'open-locational', key: '\`', opposite: '\`', kind: 'delimiter', open: true};
const closeConcept  = {name: 'close-conceptual', key: '"', opposite: '"', kind: 'delimiter', close: true};
const closeLocation = {name: 'close-locational', key: '\`', opposite: '\`', kind: 'delimiter', close: true};

const openLiteralDelimitingOperators  =
        {
          '"':  openConcept,
          '\`': openLocation,

          _inverse: {
            '"':  openConcept,
            '\'': openLocation,
          }
        };
const closeLiteralDelimitingOperators =
        {
          '"':  closeConcept,
          '\`': closeLocation,

          _inverse: {
            '"':  closeConcept,
            '\`': closeLocation,
          }
        };

export const literalDelimitingOperators =
               {
                 open:  openLiteralDelimitingOperators,
                 close: closeLiteralDelimitingOperators,
               };

import {operationalPartOptions} from "./parts/parts.mjs";
import {takeSpaces}             from "../semantic/phrasal/cursor/motions/takeSpaces.mjs";
import {pragmaticOperators}     from "./parts/operators.mjs";
import {_operator}              from "../generator.builder.mjs";

export function* operational(start, prev, domain = pragmaticOperators) {
  const cursor = start.spawn(prev);
  cursor.token({kind: 'operational'});

  yield* cursor.log({message: 'checking operational'});

  let {head, body, tail, operators, initialProto,} = yield* loop(cursor, prev, domain);
  if (!operators.length) {
    yield* cursor.log({
                        message: 'not operational',
                        miss:    'no operators'
                      });
    return false;
  }

  const isNominal = initialProto?.kinds?.has('nominal');
  if (isNominal && !tail) {
    tail = null;
  }

  cursor.token({operators});

  if (initialProto?.kind === 'delimiter') {
    return cursor;
  }

  if (operators.length === 1) {
    cursor.token({kind: initialProto.kind})
    cursor.token({kind: initialProto.name})
  }

  if (typeof tail === 'undefined') {
    yield* cursor.log({
                        message: 'not operational',
                        miss:    'missing a tail component',
                        cursor:  cursor,
                        info:    {
                          head, body, tail,
                          tok: cursor.token(),
                        }
                      });

    cursor.token(false);

    return false;
  }

  yield* cursor.log({
                      message: 'resolving operational',
                      cursor:  cursor
                    });

  if (!head && !tail) {
    cursor.token({kind: 'conceptual'});
  }

  cursor.token({
                 head: head,
                 body: body,
                 tail: tail,
               });

  return cursor;
}

function* loop(cursor, prev, permittedOperators) {
  const head = prev && prev.token();
  const body = [];

  if (!permittedOperators[' ']) {
    yield* takeSpaces(cursor);
  }

  const operators = [];
  let operator, initialProto;
  while (operator = yield* cursor.scan([_operator(permittedOperators)])) {
    if (!operator) continue;
    if (!operator?.token()) break;

    yield* cursor.log({message: 'beginning operational',});
    operators.push(operator.token());

    const proto = operator.token().proto;

    initialProto = initialProto ? initialProto : proto;

    if (proto.open) {
      const spaces = yield* takeSpaces(operator);
      spaces.length && body.push(spaces[0]);
    }
    if (!proto.close) {
      yield* takeSpaces(cursor);
    }

    const _cursor = yield* cursor.scan(operationalPartOptions, proto.close ? operator : undefined);
    const token     = _cursor ? _cursor.token() : null;
    if (!token) break
    body.push(token);
    yield* takeSpaces(cursor);
  }

  const tail = body.pop();
  return {
    head: head,
    body: body,
    tail: tail,

    operators:    operators,
    initialProto: initialProto
  };
}

